$(document).ready(function(){var t=[{title:"Karvy",img:'<img src="images/karvy.png" alt=""/>',content:"<p>We integrated with MANCH Technology for e-Sign to dispense with the physical applications under NPS. Integration with MANCH Technology was smooth and e-Sign facility helped us to open the online account in a paperless manner. The services of MANCH Technology are good in term of quality and responsiveness and is commendable.</p>"},{title:"Coworks",img:'<img src="images/coworks.png" alt=""/>',content:"<p>Manch has been instrumental in helping us go digital with our customer on-boarding with its user-friendly e-sign solutions and seamless integration with our internal systems</p>"},{title:"Ezetap",img:'<img src="images/ezetap.png" alt=""/>',content:"<p>Ezetap uses the services of Manch to integrate with our core on-boarding system. Using this, we have been able to cater to large enterprises that have presence across India. Manch has simplified and digitized the doc submission process with E sign. This digital onboarding process has been appreciated by our clients as well for the ease of use.</p><p>We started with Manch for E-sign process mainly to eliminate physical agreements, in person OSV process, hard copy archival. Since then, we have also done a successful integration of the Manch tool with our on-boarding tool, thus facilitating smooth data movement during the onboarding process.</p><p>Manch has been flexible in terms of delivering our requirements on time.</p><p>Thanks Team Manch, we are able to save time as well as cost by using your services. We have been able to make a transition from a person dependent, cost and time intensive process to a very agile online process for merchant onboarding.</p>"},{title:"TMI",img:'<img src="images/tmi-netwrok.png" alt=""/>',content:"<p>We have been enjoying using Manch since 2018 and we have found its tremendous benefits; it has saved paper work, printing and courier cost and also saved a lot of time of the stakeholders. It is much easier to save and maintain the records than to maintain their hard copies. The technology is user friendly and customizable, moreover one does not need to be a tech-expert to comprehend its functions. Also, we have been getting a very good technical and customer support from Manch team. Thanks and all the best to Manch.</p>"},{title:"Oxigen",img:'<img src="images/oxigen.png" alt=""/>',content:"<p>On Merchant onboarding, physical documentation was a big pain point, especially as the acquisition locations moves from urban to sub-urban/rural. Digital On-boarding by MANCH is a great solution that helped us move this process from paper based to paperless and bring great efficiency in cycle time reduction from weeks to just a day or two</p>"}];$("#clients a").click(function(e){e.preventDefault(),$("#clientsModal").modal("show");var n=$(this).data("title");$.each(t,function(e,t){t.title==n&&($("#clientsModal .modal-title").html(t.img),$("#clientsModal .modal-body").html(t.content))})})});
